#import "LunarHelper.h"

@interface LunarHelper()



@end


@implementation LunarHelper



+ (instancetype)sharedInstance
{
    static LunarHelper *instance = nil;
    static dispatch_once_t token;
    dispatch_once(&token, ^{
        instance = [[LunarHelper alloc]init];
    });
    
    return instance;
}

//计算年干支
- (NSString *)calculateYearGanZhiWithYear:(NSInteger)year month:(NSInteger)month day:(NSInteger)day
{
//    NSLog(@"%ld年%02ld月%02ld日",year,month,day);
    if(year<1890 || year>2100){
        return @"";
    }
    //立春日
    NSArray *solarTerms = self.solarTermsDic[@(year)];
    if(!solarTerms){
        return @"";
    }
    NSString *dateStr = solarTerms[0];//立春日 d0203
    int lichunDay = [[dateStr substringFromIndex:3] intValue];
    
    //立春始终在公历二月,在立春之前，属于上一年的干支
    if(month<2 || (month==2 && day<lichunDay)){
        year = year - 1;
    }
    
    //计算年干支(“公元年数先减三，除10余数是天干，基数改用12除，余数便是地支年”。)
    year = year - 3;
    NSInteger tianganIndex = (year-1) % 10;
    NSInteger dizhiIndex = (year-1) % 12;
    
    NSString *yearGanzhi = [NSString stringWithFormat:@"%@%@年",self.heavenlyStems[tianganIndex],self.earthlyBranches[dizhiIndex]];
//    NSLog(@"   %@",yearGanzhi);
    
    return yearGanzhi;
}

//计算月干支
- (NSString *)calculateMonthGanZhiWithYear:(NSInteger)year month:(NSInteger)month day:(NSInteger)day
{
    if(year<1890 || year>2100){
        return @"";
    }
    NSArray *solarTerms = self.solarTermsDic[@(year)];
    if(!solarTerms){
        return @"";
    }
    NSString *lichunDateStr = solarTerms[0];//立春日 d0203
    int lichunDay = [[lichunDateStr substringFromIndex:3] intValue];
    
    //立春始终在公历二月,在立春之前，属于上一年的干支
    if(month<2 || (month==2 && day<lichunDay)){
        year = year - 1;
    }
    
    //计算年干支(“公元年数先减三，除10余数是天干，基数改用12除，余数便是地支年”。)
    year = year - 3;
    NSInteger heaven = year % 10;
    
    //小寒日期以前为“子”，小寒起到立春前为“丑”，立春起到惊蛰前为“寅”。。。
    int dizhiIndex= 0;
    
    //12个节分别代表1~12月干支月交接日期
    NSArray *jieDates = @[solarTerms[22],solarTerms[0],solarTerms[2],solarTerms[4],solarTerms[6],solarTerms[8],
                          solarTerms[10],solarTerms[12],solarTerms[14],solarTerms[16],solarTerms[18],solarTerms[20]];
    
    
    NSString *dateStr = [NSString stringWithFormat:@"d%02ld%02ld",month,day];
    
    for(int i=0; i<[jieDates count]; i++){
        //跨一个节气对应的日期，地支索引增加1
        if([dateStr compare:jieDates[i]] != NSOrderedAscending){
            dizhiIndex ++;
        }else{
            break;
        }
    }
    //地支(1~12月)  子(index==0)对应11月，丑(index==1)对应12月，寅(index==2)对应正月...
    NSInteger dizhiMonth = (dizhiIndex - 1 + 12) % 12;
    if(dizhiMonth==0){
        dizhiMonth = 12;
    }
    //年干x2+月支 超过10则减去10的倍数到0-9，0视做10
    NSInteger tianganIndex = (heaven * 2 + dizhiMonth) % 10;
    if(tianganIndex == 0){
        tianganIndex = 10;
    }
    tianganIndex = tianganIndex - 1;
    dizhiIndex = dizhiIndex % 12;
    NSString *monthGanzhi = [NSString stringWithFormat:@"%@%@月",self.heavenlyStems[tianganIndex],self.earthlyBranches[dizhiIndex]];
//    NSLog(@"   %@",monthGanzhi);
    
    return monthGanzhi;
}

- (NSString *)getZodia:(NSInteger)year month:(NSInteger)month day:(NSInteger)day
{
    if(year<1890 || year>2100){
        return @"";
    }
    
    NSString *zodia = @"";
    NSArray *solarTerms = self.solarTermsDic[@(year)];
    if(!solarTerms){
        return @"";
    }
    NSString *lichunDateStr = solarTerms[0];//立春日 d0203
    int lichunDay = [[lichunDateStr substringFromIndex:3] intValue];
    
    //立春始终在公历二月,在立春之前，属于上一年的干支
    if(month<2 || (month==2 && day<lichunDay)){
        year = year - 1;
    }
    NSInteger num = (year % 12) -3;
    if(num<=0){
        num += 12;
    }
    switch (num) {
        case 1:
            zodia = @"鼠";
            break;
        case 2:
            zodia = @"牛";
            break;
        case 3:
            zodia = @"虎";
            break;
        case 4:
            zodia = @"兔";
            break;
        case 5:
            zodia = @"龙";
            break;
        case 6:
            zodia = @"蛇";
            break;
        case 7:
            zodia = @"马";
            break;
        case 8:
            zodia = @"羊";
            break;
        case 9:
            zodia = @"猴";
            break;
        case 10:
            zodia = @"鸡";
            break;
        case 11:
            zodia = @"狗";
            break;
        case 12:
            zodia = @"猪";
            break;
        default:
            break;
    }
    return zodia;
}

